import React, { useState, useEffect, useRef } from 'react';
import ReactMarkdown from 'react-markdown';

const ChatbotUI = () => {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const effectRan = useRef(false);

  const sendMessage = async (message) => {
    // ... (sendMessage function implementation remains unchanged)
  };

  useEffect(() => {
    if (effectRan.current === false) {
      sendMessage('Hello, AI Assistant!');
      return () => effectRan.current = true;
    }
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 p-4 md:p-8">
      <div className="max-w-6xl mx-auto grid grid-cols-1 md:grid-cols-3 gap-4 md:gap-8">
        {/* Top box */}
        <div className="md:col-span-3 bg-white p-4 rounded-lg shadow">
          <h1 className="text-2xl font-bold">Welcome to Our AI Assistant</h1>
          <p>This is the top content area where you can add introductory text or other information.</p>
        </div>

        {/* Left box */}
        <div className="bg-white p-4 rounded-lg shadow">
          <h2 className="text-xl font-semibold mb-4">Left Box</h2>
          <p>You can add navigation, additional info, or other content here.</p>
        </div>

        {/* Chatbot UI (Center box) */}
        <div className="bg-white rounded-lg shadow-lg overflow-hidden flex flex-col">
          <h2 className="text-xl font-bold p-4 bg-gray-200">AI Assistant</h2>
          <div className="flex-1 overflow-y-auto p-4 max-h-[50vh]">
            {messages.map((message, index) => (
              <div key={index} className={`mb-2 ${message.sender === 'user' ? 'text-right' : 'text-left'}`}>
                <span className={`inline-block p-2 rounded-lg ${message.sender === 'user' ? 'bg-blue-500 text-white' : 'bg-gray-100'}`}>
                  {message.sender === 'user' ? (
                    message.text
                  ) : (
                    <>
                      <ReactMarkdown>{message.text}</ReactMarkdown>
                      {message.citations && message.citations.length > 0 && (
                        <div className="mt-2 text-sm text-gray-600">
                          <strong>Citations:</strong>
                          <ol>
                            {message.citations.map((citation, idx) => {
                              const displayUrl = citation.mappedUrl || citation.originalUrl;
                              return (
                                <li key={idx}>
                                  [{citation.index}]{' '}
                                  <a
                                    href={displayUrl}
                                    target="_blank"
                                    rel="noopener noreferrer"
                                    className="text-blue-500 hover:underline"
                                  >
                                    {displayUrl}
                                  </a>
                                  {citation.error && ` (${citation.error})`}
                                </li>
                              );
                            })}
                          </ol>
                        </div>
                      )}
                    </>
                  )}
                </span>
              </div>
            ))}
          </div>
          <div className="p-4 bg-gray-200">
            <div className="flex">
              <input
                type="text"
                value={input}
                onChange={(e) => setInput(e.target.value)}
                onKeyPress={(e) => e.key === 'Enter' && !isLoading && input.trim() && sendMessage(input)}
                placeholder="Type a message..."
                className="flex-1 p-2 border rounded-l-lg"
                disabled={isLoading}
              />
              <button
                onClick={() => !isLoading && input.trim() && sendMessage(input)}
                className="p-2 bg-blue-500 text-white rounded-r-lg"
                disabled={isLoading}
              >
                Send
              </button>
            </div>
          </div>
        </div>

        {/* Right box */}
        <div className="bg-white p-4 rounded-lg shadow">
          <h2 className="text-xl font-semibold mb-4">Right Box</h2>
          <p>This area can be used for additional features, settings, or other relevant information.</p>
        </div>

        {/* Bottom box */}
        <div className="md:col-span-3 bg-white p-4 rounded-lg shadow">
          <h2 className="text-xl font-semibold mb-4">Additional Information</h2>
          <p>You can add more content, disclaimers, or any other relevant information here.</p>
        </div>
      </div>
    </div>
  );
};

export default ChatbotUI;
